 To make sense of $p(q(x))$, we need to make sense of $q(x)$. We can do this by drawing the red lines shown below to define $q(x)$.
$$
\def\thicklineskip{1.5pt}\begin{tikzpicture}[>=latex']
\draw [thick, ->] (-1.2,0) -- (5,0) node [right] {$x$};
\draw [thick] (-1,3/8) -- (0,0.75) -- (1,0) node [below] {$x=0$};
\draw [thick] (-1.5/4,-1.5/4) -- (1.5/4,1.5/4);
\draw [thick, ->] (0,-1.5/4-0.5/4) -- (0,1.5/4+0.5/4);
\draw [thick, dotted] (0,-1.5/4-0.5/4) -- (5,-1.5/4-0.5/4);
\draw [thick, dotted] (0,1.5/4+0.5/4) -- (5,1.5/4+0.5/4);
\node [left] at (0,-1.5/4-0.5/4-0.2) {$y=-\frac{1}{4}-\frac{1}{4}x$};
\node [left] at (0,1.5/4+0.5/4+0.2) {$y=\frac{3}{4}+\frac{1}{2}x$};
\node [right] at (5,0) {$x$};
\end{tikzpicture}
$$We can see that $q(x)$ is defined when $-\frac{1}{4}-\frac{1}{4}x\le y\le \frac{3}{4}+\frac{1}{2}x$. That happens when $-2.25\le x\le 4$, or when $-0.375\le x\le 4$.
